import React from "react";

function UserInitializer({socket, onUserSelect }) {
  const handleUserSelect = (userId) => {
    if (socket && socket.readyState === WebSocket.OPEN) {
      const message = { type: 'selectUser', userUUID: userId };
      socket.send(JSON.stringify(message));
    }
  };
  return (
    <div className="user-initializer">
      <p className="user" onClick={() => handleUserSelect("User 1")}>
        User 1
      </p>
      <p className="user" onClick={() => handleUserSelect("User 2")}>
        User 2
      </p>
      <p className="user" onClick={() => handleUserSelect("User 3")}>
        User 3
      </p>
    </div>
  );
}

export default UserInitializer;
